function getZxingBitmapFromCanvas(canvas) {
    const ctx = canvas.getContext('2d');
    const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height).data;

    let gray_bitmap = [];
    for (let p = 0; p < canvas.width * canvas.height * 4; p += 4) {
        const r = imageData[p] | 0;
        const g = imageData[p + 1] | 0;
        const b = imageData[p + 2] | 0;
        const gray_px = Math.floor(0.3 * r + 0.59 * g + 0.11 * b);

        // const luminance = Math.floor(0.2126 * r + 0.7152 * g + 0.0722 * b);
        gray_bitmap.push(gray_px);
    }
    const luminanceSource = new ZXing.RGBLuminanceSource(gray_bitmap, canvas.width, canvas.height);
    const binarizer = new ZXing.HybridBinarizer(luminanceSource);
    const bitmap = new ZXing.BinaryBitmap(binarizer);
    return bitmap;
}


function prepareBitMapForZxingFromCanvas(canvas) {
    const ctx = canvas.getContext('2d');
    const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height).data;

    let luminances = [];
    for (let p = 0; p < canvas.width * canvas.height * 4; p += 4) {
        const r = imageData[p];
        const g = imageData[p + 1];
        const b = imageData[p + 2];

        const luminance = Math.floor(0.2126 * r + 0.7152 * g + 0.0722 * b);
        luminances.push(luminance);
    }
    const luminanceSource = new ZXing.RGBLuminanceSource(luminances, canvas.width, canvas.height);
    const binarizer = new ZXing.HybridBinarizer(luminanceSource);
    const bitmap = new ZXing.BinaryBitmap(binarizer);
    return bitmap;
}

function resizeCanvas(canvas_src, canvas_dst, factor) {

    const cw = canvas_src.width;
    const ch = canvas_src.height;

    canvas_dst.width = Math.floor(cw * factor);
    canvas_dst.height = Math.floor(ch * factor);
    const ctx = canvas_dst.getContext('2d');
    ctx.drawImage(canvas_src, 0, 0, cw, ch, 0, 0, canvas_dst.width, canvas_dst.height);

}





